package com.tonmx.exmark.bean;

public class Point {
	int pointX;
	int pointY;
	public Point(int x,int y) {
		// TODO Auto-generated constructor stub
		pointX = x;
		pointY = y;
	}
	public int getPointX() {
		return pointX;
	}
	public int getPointY() {
		return pointY;
	}
    public void setPointX(int pointX) {
		this.pointX = pointX;
	}
    public void setPointY(int pointY) {
		this.pointY = pointY;
	}
}

